 must be unique to prevent other instances from being overlooked by assistive technologies. [Learn more](https://web.dev/duplicate-id-aria/).","score":null,"scoreDisplayMode":"notApplicable"},"form-field-multiple-labels":{"id":"form-field-multiple-labels","title":"No form fields have multiple labels","description":"Form fields with multiple labels can be confusingly announced by assistive technologies like screen readers which use either the first, the last, or all of the labels. [Learn more](https://web.dev/form-field-multiple-labels/).","score":null,"scoreDisplayMode":"notApplicable"},"frame-title":{"id":"frame-title","title":"`\u003cframe>` or `\u003ciframe>` elements have a title","description":"Screen reader users rely on frame titles to describe the contents of frames. [Learn more](https://web.dev/frame-title/).","score":null,"scoreDisplayMode":"notApplicable"},"heading-order":{"id":"heading-order","title":"Heading elements appear in a sequentially-descending order","description":"Properly ordered headings that do not skip levels convey the semantic structure of the page, making it easier to navigate and understand when using assistive technologies. [Learn more](https://web.dev/heading-order/).","score":1,"scoreDisplayMode":"binary","details":{"type":"table","headings":[],"items":[]}},"html-has-lang":{"id":"html-has-lang","title":"`\u003chtml>` element has a `[lang]` attribute","description":"If a page doesn't specify a lang attribute, a screen reader assumes that the page is in the default language that the user chose when setting up the screen reader. If the page isn't actually in the default language, then the screen reader might not announce the page's text correctly. [Learn more](https://web.dev/html-has-lang/).","score":1,"scoreDisplayMode":"binary","details":{"type":"table","headings":[],"items":[]}},"html-lang-valid":{"id":"html-lang-valid","title":"`\u003chtml>` element has a valid value for its `[lang]` attribute","description":"Specifying a valid [BCP 47 language](https://www.w3.org/International/questions/qa-choosing-language-tags#question) helps screen readers announce text properly. [Learn more](https://web.dev/html-lang-valid/).","score":1,"scoreDisplayMode":"binary","details":{"type":"table","headings":[],"items":[]}},"image-alt":{"id":"image-alt","title":"Image elements do not have `[alt]` attributes","description":"Informative elements should aim for short, descriptive alternate text. Decorative elements can be ignored with an empty alt attribute. [Learn more](https://web.dev/image-alt/).","score":0,"scoreDisplayMode":"binary","details":{"type":"table","headings":[{"key":"node","itemType":"node","text":"Failing Elements"}],"items":[{"node":{"type":"node","lhId":"4-134-IMG","selector":"div.MuiGrid-root > div.MuiGrid-root > div.info_images > img.image_m","path":"1,HTML,1,BODY,1,DIV,0,DIV,0,DIV,0,DIV,0,DIV,2,DIV,0,DIV,0,DIV,0,DIV,1,DIV,0,DIV,1,IMG","snippet":"\u003cimg src=\"/static/ministere-48d7a1b6dc12902edf63a4c606fdbaf9.png\" class=\"image_m\">","boundingRect":{"top":4788,"bottom":4882,"left":58,"right":303,"width":245,"height":94},"explanation":"Fix any of the following:\n  Element does not have an alt attribute\n  aria-label attribute does not exist or is empty\n  aria-labelledby attribute does not exist, references elements that do not exist or references elements that are empty\n  Element has no title attribute\n  Element's default semantics were not overridden with role=\"none\" or role=\"presentation\"","nodeLabel":"img"}}],"debugData":{"type":"debugdata","impact":"critical","tags":["cat.text-alternatives","wcag2a","wcag111","section508","section508.22.a","ACT"]}}},"input-image-alt":{"id":"input-image-alt","title":"`\u003cinput type=\"image\">` elements have `[alt]` text","description":"When an image is being used as an `\u003cinput>` button, providing alternative text can help screen reader users understand the purpose of the button. [Learn more](https://web.dev/input-image-alt/).","score":null enter\"/>\u003c/picture>\u003c/noscript>\u003c/div>\u003cdiv class=\"homepage-module--title_image_home--sUqFr\">\u003cdiv class=\"title_image_container\">\u003cdiv class=\"image_container\">\u003cimg style=\"width:100%;height:100%;margin-bottom:0\" src=\"/static/a75cac2444a7a3ce70666a7d5fb1a64c/trait_bleu.svg\" alt=\"logo\"/>\u003c/div>\u003ch3 class=\"title\">en bref...\u003c/h3>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-container\">\u003cdiv class=\"homepage-module--boxes_container_home--19ekt\">\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-6 MuiGrid-grid-md-4\">\u003cdiv class=\"box_container\">\u003cdiv class=\"info\">\u003ch4 class=\"title\">Éducation à l’orientation\u003c/h4>\u003cp class=\"description justifyText\">Diagoriente propose différents usages en collectif ou en face à face basés sur une pédagogie qui vise à construire des prises de décision émancipatrices des personnes.\u003c/p>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div> \u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-6 MuiGrid-grid-md-4\">\u003cdiv class=\"box_container\">\u003cdiv class=\"info\">\u003ch4 class=\"title\">NON au déterminisme !\u003c/h4>\u003cp class=\"description justifyText\">Diagoriente s’engage à détruire les croyances limitantes, les stéréotypes métiers et réduire l’indécision vocationnelle pour se dessiner un avenir.\u003c/p>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div> \u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-6 MuiGrid-grid-md-4\">\u003cdiv class=\"box_container\">\u003cdiv class=\"info\">\u003ch4 class=\"title\">Orientation dans les territoires\u003c/h4>\u003cp class=\"description justifyText\">Parce que c’est dans la vraie vie que l’orientation se construit, Diagoriente propose des expériences réelles de métiers autour de chez soi.\u003c/p>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div> \u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-6 MuiGrid-grid-md-4\">\u003cdiv class=\"box_container\">\u003cdiv class=\"info\">\u003ch4 class=\"title\">Gratuit !\u003c/h4>\u003cp class=\"description justifyText\">Ici le code est libre et ouvert. L’application est ouverte à tous et ne peut faire l’objet d’une vente dans le cadre d’un accompagnement pour définir des choix d’orientation.\u003c/p>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div> \u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-6 MuiGrid-grid-md-4\">\u003cdiv class=\"box_container\">\u003cdiv class=\"info\">\u003ch4 class=\"title\">Des appuis solides\u003c/h4>\u003cp class=\"description justifyText\">Pour valoriser les compétences transversales, l’outil s’appuie sur le référentiel RECTEC élaboré en lien avec le Cadre Européen des Certifications.\u003c/p>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div>\u003cdiv class=\"description justifyText\">\u003c/div> \u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"homepage-module--chiffrement_home--3xaDC\">\u003cdiv class=\"homepage-module--wrapper_content_home--1e452\">\u003cdiv class=\"homepage-module--head_home--1XO5e\">\u003cdiv class=\"homepage-module--title_image_home--sUqFr\">\u003cdiv class=\"title_image_container\">\u003cdiv class=\"image_container\">\u003cimg style=\"width:100%;height:100%;margin-bottom:0\" src=\"/static/a75cac2444a7a3ce70666a7d5fb1a64c/trait_bleu.svg\" alt=\"logo\"/>\u003c/div>\u003ch3 class=\"title\">...Et en chiffres\u003c/h3>\u003c/div>\u003c/div>\u003cdiv class=\"homepage-module--boxes_container_home--19ekt\">\u003cdiv class=\"MuiGrid-root MuiGrid-container\">\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"homepage-module--slider_wrapper_home--3ETAB\">\u003cdiv class=\"homepage-module--head_home--1XO5e\">\u003cdiv class=\"homepage-module--title_image_slider_home--AHMC5\">\u003cdiv class=\"title_image_container\">\u003cdiv class=\"image_container\">\u003cimg style=\"width:100%;height:100%;margin-bottom:0\" src=\"/static/eac2a496818614c7b0d2ec8a6f01cd77/trait_rose.svg\" alt=\"logo\"/>\u003c/div>\u003ch3 class=\"title\">Ils en parlent mieux que nous\u003c/h3>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"MuiGrid-root MuiGrid-container\">\u003cdiv class=\"MuiGrid-root MuiGrid-item MuiGrid-grid-xs-12 MuiGrid-grid-sm-12 MuiGrid-grid-md-12\">\u003cdiv class=\"slider_container\">\u003cdiv class=\"content\">\u003cdiv class=\"prev_arrow\">&lt;\u003c/div>\u003cdiv class=\"slider_wrapper\">\u003cdiv style=\"height:365px\">\u003cdiv class=\"eg-flick-viewport\">\u003cdiv class=\"eg-flick-camera\">\u003cdiv class=\"item current_item\">\u003cdiv class=\"item_content\">\u003cdiv class=\"text\">Une jeune m&#x27;a répondu qu&#x27;elle avait découvert des compétences qu&#x27;elle ne soupçonnait pas avoir, elle a adoré. Sa carte de compétences c&#x27;est son CV !\u003c/div>\u003cdiv class=\"user\">Valérie\u003c!-- --> \u003c/div>\u003cdiv class=\"job_user_slider\">Conseillère Mission Locale du Douaisis\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"item item_next\">\u003cdiv class=\"item_content\">\u003cdiv class=\"text\">Je trouve votre guide de prise en main très clair ! Je suis en lycée et utilise Diagoriente avec les élèves de seconde et première, ils en sont très contents. Un questionnement se met en place et c’est vraiment ce que nous recherchons avec eux. Les métiers proposés permettent d’élargir leur palette de choix ce qui est vraiment intéressant. \u003c/div>\u003cdiv class=\"user\">S.\u003c!-- --> \u003c!-- -->Rolland\u003c/div>\u003cdiv class=\"job_user_slider\">Professeur-documentaliste\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"item\">\u003cdiv class=\"item_content\">\u003cdiv class=\"text\">J’ai testé l’outil en distanciel avec une jeune et elle a beaucoup apprécié. On est resté sur notre faim car dans la dernière partie “les métiers qui t’intéressent”, il n’y a pas d’informations sur le type de formation à entreprendre (est indiqué que le niveau d’étude) et où la faire.\u003c/div>\u003cdiv class=\"user\">L.\u003c!-- --> \u003c!-- -->JACQUES\u003c/div>\u003cdiv class=\"job_user_slider\">Conseillère Référente Garantie Jeunes\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"item\">\u003cdiv class=\"item_content\">\u003cdiv class=\"text\">Je tiens à vous remercier pour votre projet Diagoriente, car il m&#x27;a permis de m&#x27;apercevoir qu&#x27;en réalité il y a beaucoup plus de pistes de métiers qui me correspondent par rapport à ce que j&#x27;imaginais.\u003c/div>\u003cdiv class=\"user\">Manon\u003c!-- --> \u003c/div>\u003cdiv class=\"job_user_slider\">(jeune) Garantie jeunes Orléans\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"item item_prev\">\u003cdiv class=\"item_content\">\u003cdiv class=\"text\">Merci pour la formation « Prise en main » maintenant nous déployons Diagoriente pour tous nos jeunes et notre priorité est le repérage des PMSMP, votre outil est absolument top !\u003c/div>\u003cdiv class=\"user\">Denis\u003c!-- --> \u003c/div>\u003cdiv class=\"job_user_slider\">Responsable de service Paris\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"next_arrow\">&gt;\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003c/div>\u003cdiv class=\"homep   <script>console.log('window.__LIGHTHOUSE_JSON__', __LIGHTHOUSE_JSON__);</script>
  <script>
    function __initLighthouseReport__() {
      const dom = new DOM(document);
      const renderer = new ReportRenderer(dom);

      const container = document.querySelector('main');
      renderer.renderReport(window.__LIGHTHOUSE_JSON__, container);

      // Hook in JS features and page-level event listeners after the report
      // is in the document.
      const features = new ReportUIFeatures(dom);
      features.initFeatures(window.__LIGHTHOUSE_JSON__);

      // No UI for treemap yet. For now, must run this command in console.
      globalThis._tmpFeatures = features;
      const command = 'ReportUIFeatures.openTreemap(_tmpFeatures.json);';
      console.log(`For treemap viewer, run: ${command}`);
    }
    window.addEventListener('DOMContentLoaded', __initLighthouseReport__);

    document.addEventListener('lh-analytics', e => {
      if (window.ga) {
        ga(e.detail.cmd, e.detail.fields);
      }
    });

    document.addEventListener('lh-log', e => {
      const logger = new Logger(document.querySelector('#lh-log'));

      switch (e.detail.cmd) {
        case 'log':
          logger.log(e.detail.msg);
          break;
        case 'warn':
          logger.warn(e.detail.msg);
          break;
        case 'error':
          logger.error(e.detail.msg);
          break;
        case 'hide':
          logger.hide();
          break;
      }
    });
  </script>
